INSERT INTO `faqs` (`id`, `question`, `answer`, `created_at`, `updated_at`, `deleted_at`) VALUES
(37, 'When can I avail a care and repair plan of the product?', 'You can avail this service for all products after brand warranty or guarantee.\r\nIn case a brand doesn’t provide support for you then you can call our consumer center to assist you.', '2022-06-05 10:03:00', '2022-06-05 10:03:00', NULL),
(38, 'What kinds of repair services of electronics do we provide?', 'You will be served for any kind of breakdown or technical issue you are facing with your appliances and you are going to have the best fixing.', '2022-06-05 10:03:00', '2022-06-05 10:03:00', NULL),
(39, 'Is it worth it if I ask for repair of my 2 years old appliance?', 'Generally speaking, it\'s worth fixing a 2-year used appliance. They can undoubtedly keep going for quite more time if appropriately kept up with and really focused on.', '2022-06-05 10:03:00', '2022-06-05 10:03:00', NULL),
(40, 'How much will it cost to fix a refrigerator?', 'It depends on the model and it will be easy to know after a team visit, they will make sure whether it just needs a simple repair or replacement of a part.', '2022-06-05 10:03:00', '2022-06-05 10:03:00', NULL),
(41, 'Can you repair the microwave?', 'Yes, our qualified staff is able to do so.', '2022-06-05 10:03:00', '2022-06-05 10:03:00', NULL),
(42, 'How do I know that I can call you for repair?', 'When you realize that your product is not working properly it’s giving you any missing information. Now it’s time to make a call and discuss it with our cooperative staff.', '2022-06-05 10:03:00', '2022-06-05 10:03:00', NULL),
(43, 'What will you recommend to clear cleanser filth out of the dishwasher?', 'Well, there are so many products and home remedies that can be used to clean up your dishwasher. If they aren’t working call our technicians, they will guide you what to use according to the problem you are facing.', '2022-06-05 10:03:00', '2022-06-05 10:03:00', NULL),
(44, 'Do you provide repair service for some specific brands?', 'No, we do not serve any specific brand.', '2022-06-05 10:03:00', '2022-06-05 10:03:00', NULL),
(45, 'Can you tell me why my dishes are coming out greasy?', 'There are numerous things that may cause dished notes to come out clean and they are out cloudy and greasy. Maybe it is because soap scum is built up on dishwasher spray arms, or there is a clotting in the filter, and there is another thing that you have used too much soap and it came out cloudy.', '2022-06-05 10:03:00', '2022-06-05 10:03:00', NULL),
(46, 'How to schedule an appointment for a team visit?', 'Call our customer care center to talk about your issue. They will answer about it if you need a team visit or not and they will configure the availability of staff as soon as possible.', '2022-06-05 10:03:00', '2022-06-05 10:03:00', NULL),
(47, 'What information do I need to share for a team visit?', 'Nothing more than your name, number, address, Email and brand appliance reported issue.', '2022-06-05 10:03:00', '2022-06-05 10:03:00', NULL),
(48, 'What payment methods do you accept?', 'You can pay through Visa, MasterCard or cash as well.', '2022-06-05 10:03:00', '2022-06-05 10:03:00', NULL);
