(2, 'Return & Cancellations', 'Return and Cancellations - Home Appliances - 101Electronics', 'Explore hassle-free returns and cancellations on home appliances at 101Electronics. Our customer-centric policy ensures satisfaction.', '<p>While we need you to be satisfied with your new buying of home improvement appliances, we see some of the time you might alter your perspective or you just changed your mind. so if you ask us to return your purchased item in the time duration of 2 working days chilling period, so you are responsible for returning expense of the product\'s original condition to the specialists of&nbsp;101&nbsp;Electronics &nbsp;or consult to our return center.&nbsp;</p><p>If the product is delivered by courier or where pertinent, of them collecting the Product from you.&nbsp;</p><p>&nbsp;</p><p><strong>You should know:</strong>&nbsp;</p><p>First of all, you must pay the service charges for returning an item. The amount of the shipping will be deducted from your refund, and you\'ll have to pay for the return shipping. Exchanges may take a few days, depending on the product and location. In addition, the Consumer Protection regulations give you the right to cancel your purchase. This right is valid for 7 days from the date you received the goods. You can cancel a purchase over the telephone, and if you do, you\'ll have to pay a cancellation fee.&nbsp;</p><p>&nbsp;</p><p>Second, you\'ll need to pay an Easy Return fee. Unlike many other online retailers, Collections Etc. doesn\'t charge an up-front fee. Remember to seal the package with a strong tape to ensure your return arrives at the warehouse without any problems.&nbsp;</p><p><strong>Our customer care center:</strong>&nbsp;</p><p>Contact with our professional workers who are trained professionally, as they will give you a profits following record for you to finish and send back with the Products, alongside a duplicate of your confirmation of purchasing with our store. Any delivered Product can be return on your own returning expense, just in 7 days of your notification to us. Assuming your order was delivered by a dispatch, courier contact our costumers care center for our returning policy&nbsp;</p><p><strong>If you received defective good:</strong>&nbsp;</p><p>We truly do understand that incidentally you might encounter or experience an issue or have a defective item, and we are here to help. The initial steps will be to check whether we can resolve what is going on. To do this you just contact to our one the given numbers on the other hand you can knock us through email. So that cooperated expert who will be glad to come and figure out any issues you have with your item. First we will notify you via text or email about our expert that is going to visit over.&nbsp;&nbsp;</p><p>Another advantage of using a return and collection company is that they\'ll have a streamlined process. The cost of operating a business is not just a cost, but also an investment in itself. A high quality returns and collections firm will be able to maximize your appliances.&nbsp;</p><p><strong>Conditions:</strong>&nbsp;</p><p>If it\'s not too much trouble, contact the expert through costumer care so they will be connected to you taking actions on the issues you are facing assuming you wish to return flawed Product. Then you will be able to be contact and discuss with us about the options that what you exactly want even if you want repair service or replacement and where suitable may analyze the Product.&nbsp;</p><p>&nbsp;In case your product is delivered by courier then contact to our consumer center Product returned by you as a result of a deformity will be refunded in full including delivery charges and the expense caused by you in returning the thing less a sensible aggregate for any missing things like remotes , cables, or any lead related to appliances . Any discount due will be handled once the Product have been assessed by our trained professional.&nbsp;</p>', 'PageBanner-20220418-1