(3, 'Ways to Pay', 'Ways To Pay - Electronics  Home Appliances - 101Electronics', 'Discover convenient ways to pay for top-quality electronics and home appliances at 101Electronics. Secure transactions for a seamless shopping experience.', '<p>101&nbsp; Electronics gives you the most fastest and reliable transections payment method there are many ways to pay against your purchasing have a look&nbsp;&nbsp;</p><p>&nbsp;</p><p>Payment methods:&nbsp;</p><p>&nbsp;</p><ul><li>Cash on delivery (COD)</li></ul><p>Cash on delivery is a way of payment where you pay for a product when you receive it where you pay when your home appliance is delivered. 101&nbsp; Electronics provides the cash on delivery service on some items for some of the specific areas.&nbsp;&nbsp;</p><p>&nbsp;</p><ul><li>Visa card</li></ul><p>101 Electronics provides you to pay through visa card.&nbsp;</p><p>A visa card can be both credit or debit too provided you by your bank.&nbsp;</p><p>&nbsp;</p><ul><li>MasterCard</li></ul><p>101 Electronics accepts payments through MasterCard.&nbsp;</p><p>&nbsp;</p><p>We accept all kind of Master &amp; Visa Cards&nbsp;&nbsp;</p><p>101 Electronics offers different type of payment method, Master &amp; Visa Card and other payment card authorized with top Pakistan bank&nbsp;&nbsp;&nbsp;</p><p>This is a great idea to purchase your Home/Office Appliances on your Visa and MasterCard; this is one of the safest ways of payment using Master and Visa Card.&nbsp;</p><p><br>&nbsp;</p>', 'PageBanner-20220417-221648.jpg', 'PageBannerMobile-20220422-120131.jpg', 3, '2022-02-03 11:57:54', '2024-03-21 07:00:49'),
(4, 'Delivery Options', 'Delivery Installation - Home Appliances - 101Electronics', 'Enhance your home with seamless convenience! Explore 101Electronics for expert delivery installation of top-tier home appliances. Elevate your lifestyle today.', '<p>When you purchase a new appliance, delivery, and installation of your appliance can be problematic. The installation process can be delayed due to miscommunication between the customer and the salesperson, inaccurate measurements, or a lack of a clear pathway to your property. Here are a few tips to make sure that your installation goes as smoothly as possible. Using a checklist to avoid delays, you can expect to enjoy hassle-free delivery and install times.&nbsp;</p><p><strong>When you shop for an appliance</strong>&nbsp;</p><p>Be sure to check on the delivery and installation before you make your final purchase. One 0 One electronics will provide you safe delivery as well as installation. If you buy an appliance online, you will have the opportunity to compare different prices and delivery and setup services to save yourself time and money. When you shop for an appliance, it is important to compare the prices, as well as the delivery and installation services provided. For example, if you order a dishwasher and pay for the delivery, the delivery and set-up team will be more than happy to help you. While we are serving a free home delivery service.&nbsp;</p><p><strong>We will coordinate:</strong>&nbsp;</p><p>Before you purchase a new washer and dryer, contact us &amp; We will coordinate the delivery and installation process. We use the safe delivery and installation services.&nbsp;</p><p><strong>We serve you with a premium way of delivery:</strong>&nbsp;</p><p>We will bring the appliances to your location packed or wrapped and will be safely delivered to your door step&nbsp; placed in your garage or first floor storage location.&nbsp;</p><p>NOTE: WE ARE OFFERING 100% FREE DELIVERY&nbsp;</p><p>This service includes normal delivery within the door step whether you are living in a house or an apartment or you want us to deliver on your commercial destination setting your appliances to the right place that you ask our workers to set up&nbsp; , normal installation, removing the packing material .&nbsp;&nbsp;</p><p>In preparation for your delivery One 0 One Electronics only asks that we have a clear pathway and full access to the delivery location&nbsp;</p><p>&nbsp;</p><p><strong>NOTE: WE ARE OFFERING 100% FREE DELIVERY</strong>&nbsp;</p><p>&nbsp;</p><p>Once you have purchased a new appliance, it is time to pay for delivery and installation. Some stores charge an additional fee for installation, but it\'s usually much affordable. Depending on the size and shape of your home, basic installation may include hauling away your old one, but you will have to pay for any additional services.<strong>But here at One 0 One electronics we install them without any cost.</strong>&nbsp;</p><p><strong>We will notify you:</strong>&nbsp;</p><p>Once your order is placed you will receive a confirmation message from company and you will be in touch with our team.&nbsp;</p><p>You may receive a call before getting your parcel delivered to ask you about your destination&nbsp;</p><p><strong>To place order:</strong>&nbsp;</p><p>To place an order you must need to select the right item that you need then go to place order and sign up first. This process is necessary because you have to put date related to delivery where you mention your name, address, location where you want us to deliver to avoid any inconvenience.&nbsp;</p><p><strong>Safe delivery:</strong>&nbsp;</p><p>One 0 One Electronics expects our customers to inspect the appliances once installed or placed in the home. Check the boxed items&nbsp; for your satisfaction . If you face any kind of problem or damages that arise must be resolved with our online selling team.&nbsp;</p><p>&nbsp;</p><p><strong>Installations All Over the PAKISTAN:</strong>&nbsp;</p><p>&nbsp;</p><p>All appliances require some installation and One 0 One Electronics provides you free installation service all over the Pakistan.&nbsp;</p><p><strong>FAQs:</strong>&nbsp;</p><p><strong>. Who will deliver my order?</strong>&nbsp;</p><p>Our team is well experienced in their fields from many years as they are licensed persons so you are not going to have any kind of risk in delivery.&nbsp;</p><p><strong>What if you cancel the order?</strong>&nbsp;</p><p>Once you placed order and canceled it for any reason before it gets delivered or not you have to pay for the service charges only.&nbsp;</p><p><strong>If a product is out of stock?</strong>&nbsp;</p><p>If any of our products is out of stock and you already had paid for, don’t need to worry about your cash will be deposited back into your account.&nbsp;</p>', 'PageBanner-2022-03-13 18-12-25.jpg', NULL, 3, '2022-02-03 11:57:57', '2024-03-21 07:07:02'),
(5, 'Price Promise', 'Price Promise - Electronics  Home Appliances - 101Electronics', 'Discover unbeatable deals at 101Electronics with our Price Promise on Electronics & Home Appliances. Shop confidently knowing you get the best prices guaranteed', '<p>At 101 Electronics, we endeavor to give our clients the best help and evaluate accessible anyplace. Assuming you observe a superior cost on any item at one more approved retailer, we will attempt to match that cost. Just contact our deals staff at 0325-101-101-9 or email us and furnish us with the archive with the distributed value before your order gets delivered.&nbsp;</p><p>We offer our customers to match their product prices with our competitors.&nbsp;</p><p>We have the best in home and kitchen apparatuses. All of our appliances sold at the internet based shop are of agreeable costs and accompanied a full plant guarantee.&nbsp;</p><p>One 0 One electronics is the internet based online shopping platform where you will find&nbsp; top quality machines that come at reasonable prices.&nbsp;</p><p>This is most certainly the web-based store for you in the event that you are intending to buy machines in bundles. one 0 one electronics offers investment funds at orders made as bundles, with kitchen gadgets&nbsp; packages&nbsp; so you can save as much.&nbsp;</p><p>Here you can get home ac, dishwashers, refrigerators, and all that your fancy home required for at your pocket friendly range.&nbsp;</p><p><strong>We sale appliances from the global brands like:</strong>&nbsp;</p><p>LG, BOSH, SAMSUNG, SONY, HITACHI, PANASONIC, IPHONE&nbsp;&nbsp;</p><p><strong>As well as we sell the Chinese brand such as:</strong>&nbsp;</p><p>TLC, HIER, MI, GREE&nbsp;</p><p><strong>We promise:</strong>&nbsp;</p><p>If, in the time slap of 30 days after your buy, you bought an item from one of our display areas and have observed a similar product publicized for less by an approved seller, we will happily discount the distinction in full.&nbsp;</p><p>&