INSERT INTO `offers` (`id`, `description`, `created_at`, `updated_at`) VALUES
(1, '<p><strong>What we offer you:</strong></p><ul><li>we will give repair service after brands warranty</li><li>you can consult for technical issues</li><li>we can provide you parts if needed for repair service</li><li>you can call our technical staff at home for seasonal services i.e., Ac, washing machines or refrigerators</li></ul><p><strong>Appointment:</strong></p><p>To make an appointment place a call to our customer care ask them for team visit date and time and they will let you know if engineers are available or not</p>', '2022-05-18 12:30:17', '2022-05-18 12:30:17');
