INSERT INTO `pricings` (`id`, `description`, `created_at`, `updated_at`) VALUES
(1, '<p>Here we are going to offer to be a part of 101 Electronics family where you have the opportunity to get a subscription plan to get our care and repair services for your fancy valued household appliances.<br>Our care and repair service provides you with a scope of administration to assist you in taking full advantage of your products.<br>It depends how long you want to go through you can select time frames that suit you as it can be yearly plans or could be set monthly. Choose any of them and we will modify it as per your requirements.<br><strong>Note: you have an option to unsubscribe or cancel it whenever you want.</strong></p><p><strong>Subscription:</strong></p><p>You can subscribe for free by registering on the website.<br>If you have subscribed or registered and are now a part of our family, we are going to provide you free consultancy of our experienced staff for free of cost if you are having problem with your appliance and engineers visit is necessary.</p><p><strong>Inspection Charges:</strong></p><p>&nbsp;</p><ol><li>Call &amp; Video inspection free against subscription</li><li>One time team visit (PKR 1000 /=)</li><li>Pick up charges (PKR 2000/=)</li><li>Repairing (will be charged)</li></ol><p>&nbsp;</p><p><strong>Get Your Below Mentioned Service Charges on Call, SMS &amp; Email</strong></p>', '2022-05-08 06:30:47', '2022-05-08 06:30:47');
