(182, 174, 'LG Air Conditioner MODEL # I18CGH-SGGF', '1.5 TON', '1', 3, 27, 49, 0, 4.9, 8, 0, '<p>LG is Korean brand &amp; this model have LG\'s Dual Inverter CompressorTM solves improper, ineffective and noisy problems, resulting in an air conditioner that cools faster, lasts longer, and runs quieter. With the 10year warranty on the compressor, users can enjoy the benefits of LG air conditioner for a longer period of time.</p><p>&nbsp;</p><h4><strong>Dual Inverter Compressor™</strong></h4><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_02_Dual-Inverter-Compressor.jpg\" alt=\" Dual Inverter Compressor™1\"></figure><p>&nbsp;</p><p>A compressor with a wider rotational frequency saves more energy and has a faster cooling range.</p><h4>&nbsp;</h4><h4><strong>10 Year Warranty</strong></h4><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_02_10-Year-Warranty.jpg\" alt=\"10 Year Warranty1\"></figure><p>&nbsp;</p><p>Verification obtained from TUV Rheinland for 10-year product life cycle.</p><p>&nbsp;</p><h4><strong>TUV Rheinland</strong></h4><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_02_TUVRheinland.jpg\" alt=\"TUV Rheinland1\"></figure><p>&nbsp;</p><p>TUV Rheinland, Verification on Fast Cooling &amp; Power Saving Rate(US-W242Kxy0/TS-H2465DA0).</p><h3>&nbsp;</h3><h3><strong>Energy Saving</strong></h3><p>Inverter Compressor constantly adjusts a compressor\'s speed to maintain desired temperature levels. Moreover, Dual Inverter Compressor™ with power saving operation range frequency saves more energy than conventional compressor.</p><h3>&nbsp;</h3><h3><strong>Fast Cooling</strong></h3><p>LG air conditioner begins cooling the air fast using its high speed cooling range with Dual Inverter Compressor™, so it expels air farther and cool spaces faster.</p><h3>&nbsp;</h3><h3><strong>Simple and Slim Design with Hidden Display</strong></h3><p>LG air conditioner‘s slim and modern design makes easy installation and convenient cleaning with EZ sliding filter. Moreover large hidden display is perfect for checking your energy display conveniently.</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_05_Simple-and-Slim-Design_D_V1.jpg\" alt=\"Simple and Slim Design with Hidden Display1\"></figure><h3><strong>Quick and Easy Installation</strong></h3><p>LG air conditioners are designed for easier and more efficient installation, regardless of the surroundings and the number of persons involved in the installation process. By reducing the manpower and time required for installation, it is now possible to install more air conditioners at more homes in a shorter period of time.</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_09_Quick-and-Easy-Installation_D.jpg\" alt=\"Quick and Easy Installation1\"></figure><h4>&nbsp;</h4><h4><strong>Vertical 6 Steps Louver Control</strong></h4><p><strong>Users can choose the vane direction among 6 preset positions to meet the exact wind blow direction you desire.</strong></p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_10_Vertical-6-steps-Louver-Control.jpg\" alt=\"Vertical 6 Steps Louver Control1\"></figure><h4>&nbsp;</h4><h4><strong>Dual Protection Filter</strong></h4><p><strong>The Dual Protection Filter captures dust size over 10㎛ and bacteria.</strong></p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_10_Dual-Protection-Filter.jpg\" alt=\"Dual Protection Filter1\"></figure><p>&nbsp;</p><h4><strong>Comfort Sleep</strong></h4><p>Comfort Sleep mode ensures the utmost comfort sleep environment by automatically adjusting 3 different functions(Indirect airflow/7hr off time set/Soft wind &amp; sleep time logic) ,with the simple click of one button.</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_11_Comfort-Sleep-NEW.jpg\" alt=\"Comfort Sleep1\"></figure><h4><strong>Auto Cleaning</strong></h4><p>The comprehensive auto cleaning function prevents the forming of bacteria and mold on the heat exchanger and thus provides a more pleasant and comfortable environment for the user.</p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_12_Auto-Cleaning.jpg\" alt=\"Auto Cleaning1\"></figure><p>&nbsp;</p><h4><strong>Gold Fin™</strong></h4><p>The Gold Fin™ ensures that the surface is more resistant to corrosion and enhances the durability of heat exchanger for a much longer period.</p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_12_Gold-Fin.jpg\" alt=\"Gold Fin™1\"></figure><p>&nbsp;</p><h4><strong>Jet Dry</strong></h4><p>Jet Dry technology places priority in dehumidification for areas with high humidity levels to keep your room dry and fresh.</p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_13_Jet-Dry.jpg\" alt=\"Jet Dry1\"></figure><h4><strong>Fast Heating</strong></h4><p>4 Way Auto Swing adjusts airflow based on the surrounding environment, allowing for optimal distribution of warm air to living areas and enabling quick heating.</p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_13_Fast-Heating.jpg\" alt=\"Fast Heating1\"></figure><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/spec/I18CGH_SK_E_03_UL2_Dimension_PC.jpg\"></figure><p>&nbsp;</p>', '<p><strong>Dual Inverter</strong></p><p><strong>TUV Rheinland</strong></p><p><strong>Energy Saving</strong></p><p><strong>Fast Cooling</strong></p><p><strong>10 Year Warranty</strong></p>', '<p><strong>Dual Inverter</strong></p><p><strong>TUV Rheinland</strong></p><p><strong>Energy Saving</strong></p><p><strong>Fast Cooling</strong></p><p><strong>10 Year Warranty</strong></p>', 'ProductPrimaryImage_20220426-224453.jpg', NULL, NULL, NULL, 'LG  Air Conditioner MODEL # I18CGH-SGGF', 'LG  Conditioner AC MODEL # I18CGH-SGGF', 'LG Conditioner AC MODEL # I18CGH-SGGF', NULL, NULL, 120198.78, 102734, 17, 17464.78, 0, 0, 120198.78, 120198.78, 10, 1, 1500, 0, 1, 0, 2000, NULL, 'lg--best-ac-model--i18cghsggf', 0, 1, '2022-04-27 03:31:48', '2023-09-21 11:35:46', '2023-09-21 11:35:46'),
(183, 175, 'LG  AC MODEL # I18CFH-SGGF Standard Plus', '1.5 TON', '1', 3, 27, 49, 0, 4.9, 8, 0, '<p>LG is Korean brand &amp; this model have LG\'s Dual Inverter CompressorTM with<strong> WIFI</strong> &nbsp;solves improper, ineffective and noisy problems, resulting in an air conditioner that cools faster, lasts longer, and runs quieter. With the 10year warranty on the compressor, users can enjoy the benefits of LG air conditioner for a longer period of time.</p><p>&nbsp;</p><h4><strong>Dual Inverter Compressor™</strong></h4><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_02_Dual-Inverter-Compressor.jpg\" alt=\" Dual Inverter Compressor™1\"></figure><p>&nbsp;</p><p>A compressor with a wider rotational frequency saves more energy and has a faster cooling range.</p><h4>&nbsp;</h4><h4><strong>10 Year Warranty</strong></h4><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_02_10-Year-Warranty.jpg\" alt=\"10 Year Warranty1\"></figure><p>&nbsp;</p><p>Verification obtained from TUV Rheinland for 10-year product life cycle.</p><p>&nbsp;</p><h4><strong>TUV Rheinland</strong></h4><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_02_TUVRheinland.jpg\" alt=\"TUV Rheinland1\"></figure><p>&nbsp;</p><p>TUV Rheinland, Verification on Fast Cooling &amp; Power Saving Rate(US-W242Kxy0/TS-H2465DA0).</p><h3>&nbsp;</h3><h3><strong>Energy Saving</strong></h3><p>Inverter Compressor constantly adjusts a compressor\'s speed to maintain desired temperature levels. Moreover, Dual Inverter Compressor™ with power saving operation range frequency saves more energy than conventional compressor.</p><h3>&nbsp;</h3><h3><strong>Fast Cooling</strong></h3><p>LG air conditioner begins cooling the air fast using its high speed cooling range with Dual Inverter Compressor™, so it expels air farther and cool spaces faster.</p><h3>&nbsp;</h3><h3><strong>Simple and Slim Design with Hidden Display</strong></h3><p>LG air conditioner‘s slim and modern design makes easy installation and convenient cleaning with EZ sliding filter. Moreover large hidden display is perfect for checking your energy display conveniently.</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_05_Simple-and-Slim-Design_D_V1.jpg\" alt=\"Simple and Slim Design with Hidden Display1\"></figure><h3><strong>Quick and Easy Installation</strong></h3><p>LG air conditioners are designed for easier and more efficient installation, regardless of the surroundings and the number of persons involved in the installation process. By reducing the manpower and time required for installation, it is now possible to install more air conditioners at more homes in a shorter period of time.</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_09_Quick-and-Easy-Installation_D.jpg\" alt=\"Quick and Easy Installation1\"></figure><h4>&nbsp;</h4><h4><strong>Vertical 6 Steps Louver Control</strong></h4><p><strong>Users can choose the vane direction among 6 preset positions to meet the exact wind blow direction you desire.</strong></p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_10_Vertical-6-steps-Louver-Control.jpg\" alt=\"Vertical 6 Steps Louver Control1\"></figure><h4>&nbsp;</h4><h4><strong>Dual Protection Filter</strong></h4><p><strong>The Dual Protection Filter captures dust size over 10㎛ and bacteria.</strong></p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_10_Dual-Protection-Filter.jpg\" alt=\"Dual Protection Filter1\"></figure><p>&nbsp;</p><h4><strong>Comfort Sleep</strong></h4><p>Comfort Sleep mode ensures the utmost comfort sleep environment by automatically adjusting 3 different functions(Indirect airflow/7hr off time set/Soft wind &amp; sleep time logic) ,with the simple click of one button.</p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_11_Comfort-Sleep-NEW.jpg\" alt=\"Comfort Sleep1\"></figure><h4>&nbsp;</h4><h4><strong>Auto Cleaning</strong></h4><p>The comprehensive auto cleaning function prevents the forming of bacteria and mold on the heat exchanger and thus provides a more pleasant and comfortable environment for the user.</p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_12_Auto-Cleaning.jpg\" alt=\"Auto Cleaning1\"></figure><p>&nbsp;</p><h4><strong>Gold Fin™</strong></h4><p>The Gold Fin™ ensures that the surface is more resistant to corrosion and enhances the durability of heat exchanger for a much longer period.</p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_12_Gold-Fin.jpg\" alt=\"Gold Fin™1\"></figure><p>&nbsp;</p><h4><strong>Jet Dry</strong></h4><p>Jet Dry technology places priority in dehumidification for areas with high humidity levels to keep your room dry and fresh.</p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_13_Jet-Dry.jpg\" alt=\"Jet Dry1\"></figure><h4><strong>Fast Heating</strong></h4><p>4 Way Auto Swing adjusts airflow based on the surrounding environment, allowing for optimal distribution of warm air to living areas and enabling quick heating.</p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_13_Fast-Heating.jpg\" alt=\"Fast Heating1\"></figure><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/spec/I18CGH_SK_E_03_UL2_Dimension_PC.jpg\"></figure><p>&nbsp;</p>', '<p><strong>Dual Inverter-WIFI</strong></p><p><strong>TUV Rheinland</strong></p><p><strong>Energy Saving</strong></p><p><strong>Fast Cooling</strong></p><p><strong>10 Year Warranty</strong></p>', '<p><strong>Dual Inverter-WIFI</strong></p><p><strong>TUV Rheinland</strong></p><p><strong>Energy Saving</strong></p><p><strong>Fast Cooling</strong></p><p><strong>10 Year Warranty</strong></p>', 'ProductPrimaryImage_20220426-230128.jpg', NULL, NULL, NULL, 'LG  AC MODEL # I18CFH-SGGF Standard Plus', 'LG  AC MODEL # I18CFH-SGGF Standard Plus', 'LG  AC MODEL # I18CFH-SGGF Standard Plus', NULL, NULL, 144999.27, 123931, 17, 21068.27, 1, 1449.9927, 144999.27, 143549.2773, 10, 0, 0, 0, 1, 1, 0, NULL, 'lg--ac-model--i18cfh-sggf-standard-plus', 0, 0, '2022-04-27 03:58:19', '2023-09-21 11:35:38', '2023-09-21 11:35:38');
INSERT INTO `products` (`id`, `order_no`, `name`, `code`, `brand`, `category`, `sub_category`, `sub_subcategory`, `clearance_sale`, `rating`, `review`, `installment_calculator`, `description`, `short_description`, `compare_description`, `primary_img`, `size_packaging_img`, `video_link`, `video_file`, `meta_title`, `meta_desc`, `meta_tags`, `meta_img`, `color_variants`, `unit_price`, `purchase_price`, `tax`, `tax_price`, `discount`, `discount_price`, `total_price_without_discount`, `total_price`, `quantity`, `free_shipping`, `shipping_flat_rate`, `fast_24hour_delivery`, `normal_2to3days_delivery`, `zero_free_installation`, `installation_price`, `pdf_specification`, `slug`, `draft_status`, `homepage_status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(184, 176, 'LG  AC MODEL # I24CFH-SGGF-Standard Plus', '2.0 TON', '1', 3, 27, 50, 0, 4.9, 8, 0, '<p>LG is Korean brand &amp; this model have LG\'s Dual Inverter CompressorTM solves improper, ineffective and noisy problems, resulting in an air conditioner that cools faster, lasts longer, and runs quieter. With the 10year warranty on the compressor, users can enjoy the benefits of LG air conditioner for a longer period of time.</p><p>&nbsp;</p><h4><strong>Dual Inverter Compressor™</strong></h4><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_02_Dual-Inverter-Compressor.jpg\" alt=\" Dual Inverter Compressor™1\"></figure><p>&nbsp;</p><p>A compressor with a wider rotational frequency saves more energy and has a faster cooling range.</p><h4>&nbsp;</h4><h4><strong>10 Year Warranty</strong></h4><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_02_10-Year-Warranty.jpg\" alt=\"10 Year Warranty1\"></figure><p>&nbsp;</p><p>Verification obtained from TUV Rheinland for 10-year product life cycle.</p><p>&nbsp;</p><h4><strong>TUV Rheinland</strong></h4><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_02_TUVRheinland.jpg\" alt=\"TUV Rheinland1\"></figure><p>&nbsp;</p><p>TUV Rheinland, Verification on Fast Cooling &amp; Power Saving Rate(US-W242Kxy0/TS-H2465DA0).</p><h3>&nbsp;</h3><h3><strong>Energy Saving</strong></h3><p>Inverter Compressor constantly adjusts a compressor\'s speed to maintain desired temperature levels. Moreover, Dual Inverter Compressor™ with power saving operation range frequency saves more energy than conventional compressor.</p><h3>&nbsp;</h3><h3><strong>Fast Cooling</strong></h3><p>LG air conditioner begins cooling the air fast using its high speed cooling range with Dual Inverter Compressor™, so it expels air farther and cool spaces faster.</p><h3>&nbsp;</h3><h3><strong>Simple and Slim Design with Hidden Display</strong></h3><p>LG air conditioner‘s slim and modern design makes easy installation and convenient cleaning with EZ sliding filter. Moreover large hidden display is perfect for checking your energy display conveniently.</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_05_Simple-and-Slim-Design_D_V1.jpg\" alt=\"Simple and Slim Design with Hidden Display1\"></figure><h3><strong>Quick and Easy Installation</strong></h3><p>LG air conditioners are designed for easier and more efficient installation, regardless of the surroundings and the number of persons involved in the installation process. By reducing the manpower and time required for installation, it is now possible to install more air conditioners at more homes in a shorter period of time.</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_09_Quick-and-Easy-Installation_D.jpg\" alt=\"Quick and Easy Installation1\"></figure><h4>&nbsp;</h4><h4><strong>Vertical 6 Steps Louver Control</strong></h4><p><strong>Users can choose the vane direction among 6 preset positions to meet the exact wind blow direction you desire.</strong></p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_10_Vertical-6-steps-Louver-Control.jpg\" alt=\"Vertical 6 Steps Louver Control1\"></figure><h4>&nbsp;</h4><h4><strong>Dual Protection Filter</strong></h4><p><strong>The Dual Protection Filter captures dust size over 10㎛ and bacteria.</strong></p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_10_Dual-Protection-Filter.jpg\" alt=\"Dual Protection Filter1\"></figure><p>&nbsp;</p><h4><strong>Comfort Sleep</strong></h4><p>Comfort Sleep mode ensures the utmost comfort sleep environment by automatically adjusting 3 different functions(Indirect airflow/7hr off time set/Soft wind &amp; sleep time logic) ,with the simple click of one button.</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_11_Comfort-Sleep-NEW.jpg\" alt=\"Comfort Sleep1\"></figure><h4><strong>Auto Cleaning</strong></h4><p>The comprehensive auto cleaning function prevents the forming of bacteria and mold on the heat exchanger and thus provides a more pleasant and comfortable environment for the user.</p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_12_Auto-Cleaning.jpg\" alt=\"Auto Cleaning1\"></figure><p>&nbsp;</p><h4><strong>Gold Fin™</strong></h4><p>The Gold Fin™ ensures that the surface is more resistant to corrosion and enhances the durability of heat exchanger for a much longer period.</p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_12_Gold-Fin.jpg\" alt=\"Gold Fin™1\"></figure><p>&nbsp;</p><h4><strong>Jet Dry</strong></h4><p>Jet Dry technology places priority in dehumidification for areas with high humidity levels to keep your room dry and fresh.</p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_13_Jet-Dry.jpg\" alt=\"Jet Dry1\"></figure><h4><strong>Fast Heating</strong></h4><p>4 Way Auto Swing adjusts airflow based on the surrounding environment, allowing for optimal distribution of warm air to living areas and enabling quick heating.</p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Global_DualCool-E-look_2016_Feature_13_Fast-Heating.jpg\" alt=\"Fast Heating1\"></figure><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/spec/I24CFH-Dimensional_Image-D.jpg\" alt=\"I24CFH\"></figure><p>&nbsp;</p>', '<p><strong>Dual Inverter-WIFI</strong></p><p><strong>TUV Rheinland</strong></p><p><strong>Energy Saving</strong></p><p><strong>Fast Cooling</strong></p><p><strong>10 Year Warranty</strong></p>', '<p><strong>Dual Inverter-WIFI</strong></p><p><strong>TUV Rheinland</strong></p><p><strong>Energy Saving</strong></p><p><strong>Fast Cooling</strong></p><p><strong>10 Year Warranty</strong></p>', 'ProductPrimaryImage_20220426-230538.jpg', NULL, NULL, NULL, 'LG  AC MODEL # I24CFH-SGGF-Standard Plus', 'LG  AC MODEL # I24CFH-SGGF-Standard Plus', 'LG  AC MODEL # I24CFH-SGGF-Standard Plus', NULL, NULL, 146198.52, 124956, 17, 21242.52, 1, 1461.9852, 146198.52, 144736.5348, 10, 0, 0, 0, 1, 1, 0, NULL, 'lg--ac-model--i24cfh-sggf-standard-plus', 0, 0, '2022-04-27 04:01:36', '2023-09-21 11:35:33', '2023-09-21 11:35:33'),
(185, 177, 'LG  AC MODEL # A18CMH-SGGF Art Cool', '1.5 TON', '1', 3, 27, 49, 0, 4.9, 8, 0, '<h4><strong>Stylish ARTCOOL Design</strong></h4><p>The LG ARTCOOL air conditioner is designed to be harmonized with the interior of your home with minimal and basic style. The mirror glass on the front of the product reflects the surrounding environment to emphasize the interior and the integrity, and it delivers timeless beauty through the solidity of the glass material.</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/StylishDesign_Des.jpg\" alt=\"Stylish ARTCOOL Design\"></figure><p>&nbsp;</p><h4><strong>Inverter Compressor With 10 Year Warranty</strong></h4><p>LG\'s Inverter Compressor solves improper, ineffective and noise problems, resulting in an air conditioner that cools faster, lasts longer, and runs quieter. With the 10year warranty on the compressor, users can enjoy the benefits of LG air conditioner for a longer period of time.</p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/SmartInverter_D_v1.jpg\" alt=\"Inverter Compressor With 10 Year Warranty<br>1\"></figure><h4>&nbsp;</h4><h4><strong>Energy Saving &amp; Fast Cooling</strong></h4><p>Inverter Compressor constantly adjusts a compressor\'s speed to maintain desired temperature levels. Moreover, Inverter Compressor with power saving operation range frequency saves more energy than conventional compressor. Thanks to the Inverter Compressor, air is expelled farther and faster.</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/FastCooling_D_v1.jpg\" alt=\"Energy Saving &amp; Fast Cooling1\"></figure><p>&nbsp;</p><h4><strong>Ionizer</strong></h4><p>Over 3 million lons sterilize not only the air going through the air conditioner, but also harmful substances and odours surrounding the unit. Ionizer has been proven to sterilize over 99% of adhering bacteria within 60 minutes. (Sterilize Escherichia coli over 99.9% in 30 min and Staphylococcus aureus over 99.6% in 60 min)</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Ionizer_Dn_v2.jpg\" alt=\"   Ionizer  3\"><figcaption>*The test was performed by INTERTEK ETL SEMKO Korea Ltd. (Test report No.: IF 13-RE00573)<br>*The chamber size: 52m3 vloume<br>*The results may differ from results in actual room conditions</figcaption></figure><h2>&nbsp;</h2><h4><strong>Low Noise</strong></h4><p>LG air conditioners operate at low sound levels, thanks to LG\'s unique skew fan and Inverter Compressor which eliminate unnecessary noise and allow for smooth operation.</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/LowNoise_D_v1.jpg\" alt=\"Low Noise\"></figure><h4>&nbsp;</h4><h4><strong>Quick and Easy Installation</strong></h4><p>LG air conditioners are designed for easier and more efficient installation, regardless of the surroundings and the number of persons involved in the installation process. By reducing the manpower and time required for installation, it is now possible to install more air conditioners at more homes in a shorter period of time.</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/EasyInstallation_D_v1.jpg\" alt=\"Quick and Easy Installation<br>1\"></figure><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/ActiveEnergyControl.jpg\" alt=\"Active Energy Control1\"></figure><p>Active Energy Control function allows you to select the level of energy consumption depending on the situation. Enjoy a cool and comfortable atmosphere with saving energy.</p><p><strong>Active Energy Control</strong></p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/jetCool.jpg\" alt=\"Jet Cool1\"></figure><p>The optimized design of the air outlet provides more powerful airflow, which cools the room quickly.</p><p><strong>Jet Cool</strong></p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/AutoCleaning.jpg\" alt=\"Auto Cleaning\"></figure><p>The comprehensive auto cleaning function prevents the forming of bacteria and mold on the heat exchanger and thus provides a more pleasant and comfortable environment for the user.</p><p><strong>Auto Cleaning</strong></p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/Vertical6.jpg\" alt=\"Vertical 6 Steps Louver1\"></figure><p>Users can choose the vane direction among 6 preset positions to meet the exact wind blow direction you desire.</p><p><strong>Vertical 6 Steps Louver</strong></p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/4WaySwing.jpg\" alt=\"4 Way Swing1\"></figure><p>LG air conditioners deliver cool air to every corner of your room. The 4 way swing function blows the air quickly and efficiently in many directions.</p><p><strong>4 Way Swing</strong></p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/GoldFin.jpg\" alt=\"Gold Fin™1\"></figure><p>The Gold Fin™ ensures that the surface is more resistant to corrosion and enhances the durability of heat exchanger for a much longer period.</p><p><strong>Gold Fin™</strong></p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/AC/features/DualProtectionFilter-new.jpg\" alt=\"DUAL Protection Filter1\"></figure><p>The DUAL Protection Filter captures dust size over 10㎛.</p><p><strong>DUAL Protection Filter</strong></p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.lg.com/ae/images/spec/A18CMH_Dimension_Image_D.jpg\" alt=\"A18CMH-V1\"></figure>', '<p><strong>Dual Inverter</strong></p><p><strong>TUV Rheinland</strong></p><p><strong>Energy Saving</strong></p><p><strong>Fast Cooling</strong></p><p><strong>10 Year Warranty</strong></p>', '<p><strong>Dual Inverter</strong></p><p><strong>TUV Rheinland</strong></p><p><strong>Energy Saving</strong></p><p><strong>Fast Cooling</strong></p><p><strong>10 Year Warranty</strong></p>', 'ProductPrimaryImage_20220426-231221.jpg', NULL, NULL, NULL, 'LG  AC MODEL # A18CMH-SGGF Art Cool', 'LG  AC MODEL # A18CMH-SGGF Art Cool', 'LG  AC MODEL # A18CMH-SGGF Art Cool', NULL, NULL, 146198.52, 124956, 17, 21242.52, 1, 1461.9852, 146198.52, 144736.5348, 10, 0, 0, 0, 1, 1, 0, NULL, 'lg--ac-model--a18cmh-sggf-art-cool', 0, 0, '2022-04-27 04:06:47', '2023-09-21 11:35:30', '2023-09-21 11:35:30'),
(186, 178, 'LG TWIN WASHER  MODEL # F20L2CRV2E2_F70E1UDNK9', '23.5/12 KG CPACITY', '1', 5, 10, 70, 0, 4.7, 7, 0, '<p><strong>World 1st Wash &amp; Spin; Two Loads at the same time; Separae Wash: is a washing solution that has never existed before. It is all about efficiency, helping you get more clothes cleaner in less time by washing two separate loads simultaneously LG TWINWash™, Washer &amp; Dryer, 23.5 / 12 Kg, 6 Motion Direct Drive, TurboWash360, Steam™, ThinQ</strong></p>', '<p><strong>Two Loads&nbsp;</strong></p><p><strong>&nbsp;Separae Washer</strong></p><p><strong>&nbsp;6 Motion Drive</strong></p><p><strong>TurboWash360&nbsp;</strong></p><p><strong>Steam™ ,ThinQ</strong></p>', '<p><strong>Two Loads&nbsp;</strong></p><p><strong>&nbsp;Separae Washer</strong></p><p><strong>&nbsp;6 Motion Drive</strong></p><p><strong>TurboWash360&nbsp;</strong></p><p><strong>Steam™ ,ThinQ</strong></p>', 'ProductPrimaryImage_20220430-232419.png', NULL, NULL, NULL, 'LG WASHER DRYER MODEL # F20L2CRV2E2_F70E1UDNK9', 'LG WASHER DRYER MODEL # F20L2CRV2E2_F70E1UDNK9', 'LG WASHER DRYER MODEL # F20L2CRV2E2_F70E1UDNK9', NULL, NULL, 386199.45, 330085, 17, 56114.45, 1, 3861.9945, 386199.45, 382337.4555, 10, 0, 0, 0, 1, 1, 0, NULL, 'lg-washer-dryer-model--f20l2crv2e2_f70e1udnk9', 0, 1, '2022-05-01 04:05:51', '2023-09-21 11:35:26', '2023-09-21 11:35:26'),
