(280, 2, 'LG Refrigerator Model GC-X257CQVV', 'Side by Side (601 L)', '1', 4, 13, 22, 0, 5, 5, 1, '<p><strong>674 liters of storage capacity:</strong> ample space for large families or those who like to stock up on groceries.</p><p><strong>Twin Cooling System:</strong> maintains optimal temperatures and humidity levels in both refrigerator and freezer compartments, preventing cross-contamination of odors and keeping food fresher for longer.</p><p><strong>Inverter Compressor:</strong> energy-efficient performance, reduces noise and vibrations, and helps save on energy costs.</p><p><strong>Water Dispenser:</strong> built-in water dispenser allows for easy access to cold water.</p><p><strong>Dark Black Finish</strong>: sleek and stylish design that will complement any kitchen decore.</p><p><strong>Multi-air flow:</strong> multi-air flow system that helps to keep food fresh by circulating cool air evenly throughout the refrigerator.</p><p><strong>Smart diagnosis:</strong> a feature that allows you to troubleshoot any issues with your refrigerator quickly and easily.</p><p><strong>Ice maker: </strong>provides a steady supply of ice for your drinks and parties.</p><p><strong>Door Alarm:</strong> alerts you when the door is left open for too long.</p><p><strong>Energy saving mode</strong>: helps to save energy when the refrigerator is not in use.</p><p><strong>LED lighting</strong>: bright and energy-efficient lighting throughout the refrigerator.</p><p><strong>Smart ThinQ:</strong> allows you to control and monitor your refrigerator using your smartphone.</p><p><strong>Multi-air flow:</strong> multi-air flow system that helps to keep food fresh by circulating cool air evenly throughout the refrigerator.</p>', '<p>InstaView</p><p>Matte Black</p><p>Knock Twice</p><p>French Door</p><p>Linear Inverter</p>', NULL, 'ProductPrimaryImage_20230930-154758.webp', 'ProductSizePackagingImage_20230923-144936.png', NULL, NULL, 'LG INVERTER REFRIGERATOR  Model GC-X257CQVV', 'LG INVERTER 